// src/components/RFIDCounter.js
import React, { useState, useEffect } from 'react';
// import axios from 'axios';

const RFIDCounter = () => {
  const [tagCount, setTagCount] = useState(0);
  const [uniqueTags, setUniqueTags] = useState(new Set());

  useEffect(() => {
    const eventSource = new EventSource('/sse');

    eventSource.onmessage = (event) => {
      const rfidTags = JSON.parse(event.data);
      const newUniqueTags = new Set(rfidTags);
      setUniqueTags(newUniqueTags);
      setTagCount(newUniqueTags.size);
    };

    return () => {
      eventSource.close();
    };
  }, []);

  return (
    <div>
      <h1>RFID Tag Count: {tagCount}</h1>
      <ul>
        {Array.from(uniqueTags).map((tag) => (
          <li key={tag}>{tag}</li>
        ))}
      </ul>
    </div>
  );
};

export default RFIDCounter;
